import React from "react";

const OkOverlay = ({content, onClickOk, onClickClose}) => {
    return (
        <div className="centerFlex confirmOverlay">
            <span className="close" onClick={() => onClickClose()}>x</span>
            {content}
            <div style={{display: "flex", justifyContent: "space-evenly", marginTop: "1.5%",
                flexDirection: "row", width: "100%"}}>
                <button style={{width: "5em"}} className="uiButton" onClick={() => onClickOk()}>Ok</button>
            </div>
        </div>
    )
}

export default OkOverlay;
